Description:
            These are Kill La Kill inspired Purple or Red Scissor Blade phone charms. Designed and assembled by myself, the charm is made of laser cut purple mirror acrylic. Looks awesome in different lighting!
Totally unique, and an awesome accessory for yourself or a great gift for a friend!
