            This detailed tutorial (master class) on how to create the wool painting "Red Bullfinch" includes:
     •  24 page Letter-size booklet;
     •  detailed instructions;
     •  64 step-by-step photos;
     •  delivery as a PDF file.
You will learn how to:
     •  work the wool using various techniques: "pull", "pinch", & "rolling";
     •  layering of wool;
     •  color mixing and making smooth transitions;
     •  forming branches, berries, and the bird.
Tutorial is medium difficulty, but can be used by beginners; all techniques are explained.  Creation time is around 4-6 hours. 
To create a picture you will need:
     •  picture frame with glass, size 8x10 inches (20x25 cm);
     •  quilted paper towel for the base;
     •  scissors;
     •  tweezers;
     •  glue stick;
     •  wool (roving wool) in these colors: grey-blue, grassy-green, blue, turquoise, light-lilac, white, brown, dark-brown, red, white, black, grey, light-grey, dark-grey, orange, bright-red, orange-red.
The lesson is intended for personal use only. Duplication or further publication is prohibited. Using photographs or images from the lesson is prohibited. 
